import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./styles/HomePage.module.css";

function HomePage() {
  const navigate = useNavigate();
  const tenantId = 1; // Set default tenantId to 1

  const handleOrganisationsClick = () => {
    // Navigate to organisations page with tenantId
    navigate('/organisations', { state: { tenantId } });
  };

  return (
    <div className={styles.container}>
      <h1>Welcome to Requirements Tracker</h1>
      <p>Select an option from the menu to get started.</p>
      {/* You can also add a direct button to navigate to organisations if needed */}
      <button onClick={handleOrganisationsClick}>View Organisations</button>
    </div>
  );
}

export default HomePage;
